termine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100','en',1,'2006-06-09 13:59:11',NULL,NULL,'de5cbb06-30ab-102d-86b0-7a5022ba4115'),(1308,1328,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¯ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¿ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â½m in diameter with varying size and shape.\r\n\r\n','en',1,'2006-06-09 14:10:36',NULL,NULL,'de5cbedd-30ab-102d-86b0-7a5022ba4115'),(1309,1330,'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN\'s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC','en',1,'2006-06-09 14:13:05',NULL,NULL,'de5cc2ed-30ab-102d-86b0-7a5022ba4115'),(1310,1331,'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n','en',1,'2006-06-09 14:14:37',NULL,NULL,'de5cc704-30ab-102d-86b0-7a5022ba4115'),(1311,1332,'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n','en',1,'2006-06-09 14:15:28',NULL,NULL,'de5ccaef-30ab-102d-86b0-7a5022ba4115'),(1312,1333,'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ','en',1,'2006-06-09 14:16:22',NULL,NULL,'de5cceeb-30ab-102d-86b0-7a5022ba4115'),(1313,1334,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 Ã