ding to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-11-02 20:08:47',1,'2011-12-22 18:39:36','5764FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5785,119656,'An ulceration caused by prolonged pressure in patients permitted to lie too still for a long period of time. The bony prominences of the body are the most frequently affected sites. The ulcer is caused by ischemia of the underlying structures of the skin, fat, and muscles as a result of the sustained and constant pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'5785FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5799,119685,'Inflammation of the urinary bladder. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'5799FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5923,120147,'Sexually transmitted form of anogenital warty growth caused by the human papillomaviruses.','en',1,'2007-10-18 04:28:24',1,'2013-05-05 22:00:41','5923FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5924,120148,'Any variation from the normal rhythm or rate of the heart beat.','en',1,'2007-10-18 04:28:24',1,'2015-11-05 01:33:05','5924FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5938,120194,'Disorders or diseases associated with the six-to-eight-week period immediately following labor and delivery.','en',1,'2007-10-18 04:28:24',1,NULL,'5938FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6313,121262,'Infections by bacteria, general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'6313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6363,121372,'A sudden intense and continuous aggravation of a state of asthma, marked by dyspnea to the point of exhaustion and collapse and not responding to the usual therapeutic efforts.','en',1,'2007-10-18 04:28:24',1,'2014-12-22 22:22:05','6363F